import React from "react";
import "./Frame658.css";

function Frame658(props) {
  const { loadMoreProducts, className } = props;

  return (
    <div className={`frame-658 border-1px-caribbean-green ${className || ""}`}>
      <div className="load-more-products ibmplexsans-semi-bold-caribbean-green-16px">{loadMoreProducts}</div>
    </div>
  );
}

export default Frame658;
